import React from 'react'
import { motion } from 'framer-motion';

const item = {
  hidden: { y: 20, opacity: 0, scale: 0 },
  visible: {
    y: 0,
    opacity: 1,
  },
};

export default function Pin({url, key}) {
  return (
    <motion.div variants={item}>
      <img src={url} key={key} alt="" className="pin"  />
    </motion.div>
  );
}
